import ButtonAppBar from "./ButtonAppBar";

import Box from '@mui/material/Box';
import { Typography } from "@mui/material";

const OrderApproved = () => {
    return ( 
        <>
            <ButtonAppBar />
            <Box
                sx={{
                    width: 300,
                    height: 300,
                    backgroundColor: 'rgba(255, 255, 255, 0.7)',
                    boxShadow: 'rgba(0, 0, 0, 0.24) 0px 3px 8px;',                       
                    borderRadius: '20px',
                    margin: 'auto',
                    marginTop: '20px'
                }}>
                <Typography variant="h5" sx={{backgroundColor: '#E5FFF3', display: 'flex', justifyContent: 'center'}}>Beställning godkänd!</Typography>
            </Box>
        </>
     );
}

export default OrderApproved;
